    false,nt"url": null,nt"notes": "This narrative report for Hastings Wetland
    Management District outlines District accomplishments for the 1977 calendar year.
    The report begins by giving District highlights and describing the climate and habitat
    conditions in the District, as well as the land acquisition program. The construction
    and maintenance section describes recent construction and maintenance. The habitat
    management section discusses croplands, grasslands, and wetlands. Wildlife- including
    endangered and threatened species, migratory birds, upland game birds, and big game
    animals- are discussed. The public relations section discusses information and interpretation,
    recreational uses, and enforcement.  Field investigations, items of interest, and
    safety are discussed. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
